def lambda_handler(event, context):
    logger.info(f"Received event: {json.dumps(event)}")
    
    request = event["Records"][0]["cf"]["request"]
    request_path = request["uri"]
    logger.info(f"Requested path: {request_path}")

    # Check for redirect
    if request_path in REDIRECTS:
        redirect_url = REDIRECTS[request_path]
        logger.info(f"Redirecting {request_path} to {redirect_url}")
        return {
            "status": "301",
            "statusDescription": "Moved Permanently",
            "headers": {
                "location": [{"key": "Location", "value": redirect_url}],
                "cache-control": [{"key": "Cache-Control", "value": "max-age=3600"}]
            },
            "body": f"<html><head><title>301 Moved</title></head><body><h1>301 Moved</h1><p>This page has moved to <a href='{redirect_url}'>{redirect_url}</a>.</p></body></html>",
            "bodyEncoding": "text"
        }
    
    logger.info(f"No redirect found for {request_path}. Returning original request.")
    # If no redirect is found, return the original request
    return request
